def sourcs_parse(source_datas=None, white_path='./ndk_main/whiteList.xlsx'):
# def sourcs_parse(source_datas=None, white_path='./whiteList.xlsx'):
    white_json_list = []
    wb = load_workbook(white_path)
    sh = wb['WhiteList']
    for item in list(sh.rows)[1:]:
        values = []
        for val in item:
            values.append(val.value)
        api = {}
        api['api_module_name'] = values[2]
        api["api_class_name"] = values[3]
        api["name"] = values[4]
        api["ApiLevel"] = values[5]
        api["Count"] = values[6]
        api["Used"] = values[7]
        api["is_white"] = values[8]
        api["desc"] = values[9]
        white_json_list.append(api)
    new_json_list = copy.deepcopy(source_datas)
    for white_data in white_json_list:
        for i in range(0, len(source_datas)):
            white_data["api_module_name"] = white_data["api_module_name"].replace('\\', '')
            source_datas[i]["api_module_name"] = source_datas[i]["api_module_name"].replace('\\', '')
            if white_data["api_module_name"] == source_datas[i]["api_module_name"]:
                if source_datas[i]["name"] == white_data["name"]:
                    new_json_list[i]["api_used_count"] = 1
                    new_json_list[i]["api_used"] = "是"
                    new_json_list[i]["is_white"] = "是"
                    new_json_list[i]["desc"] = white_data["desc"]
    # print(new_json_list)
    return new_json_list

def api_module_name(data):
    module_name = data.split("\\")[-1]
    return module_name


